职位描述

1、负责WikiWorks业务中台、企业级SaaS应用的设计&开发;

2、分析和深入发掘现有系统的不足，提高系统性能/稳定性以及业务扩展性;

3、主要实现语言为Ruby，根据业务场景和微服务应用场景的不同，也会使用Java和go语言开发。

职位要求

1、本科及以上学历，计算机、通信等相关专业;
2、深刻理解计算机原理，有良好的数据结构和算法基础;
1、热爱编程，有较强的学习能力，有强烈的求知欲、好奇心和进取心，能及时关注和学习业界最新技术。
2、精通Java语言，熟练使用spring/mybatis/redis相关技术，了解Spring框架的基本功能和用法，有系统架构工作经验;
3、熟悉postgresql、mysql数据库，熟悉Unix/Linux操作系统;
4、分布式架构设计、开发经验;
5、加分项:Dubbo、Redis、MQ、kafka、mysql高可用以及阿里云相关技术等等。
6、能与团队合作，思路清晰，有责任心:
7、乐于学习研究新技术。
8、参与系统的总体设计、软件系统的概要设计及文档编写、评审、开发工作:
9、解决初中级开发者遇到的技术难题。
